                required
                id="productName"
                name="productName"
                label="Cap-Name"
                // value={productName}
                sx={{ mb: 2 }}
                // onChange={handleInputChange}
              />
              <TextField
                required
                id="imageUrl"
                name="imageUrl"
                // value={imageUrl}
                label="Image-URL"
                style={{ width: 400 }}
                // onChange={handleInputChange}
              />
              <TextField
                id="description"
                label="Description"
                name="description"
                value={description}
                style={{ width: 400 }}
                sx={{ mt: 2 }}
                // onChange={handleInputChange}
              />
              <TextField
                required
                id="price"
                label="Price"
                name="price"
                // value={price}
                style={{ width: 100 }}
                sx={{ mt: 2 }}
                // onChange={handleInputChange}
              />
            </FormControl>
          </Box>
        </DialogContent>
      </Dialog>
    </div>
  );
};

function printAddress(data) {
  return `${data.country}, ${data.city}, ${data.street} ${data.streetNumber}`;
}
